import React from "react";
import "../styles/Contact.css";
import "https://platform.linkedin.com/badges/js/profile.js" ;

// By importing the Contact.css file, it is added to the DOM whenever this component loads
function Contact() {
  return (
    <section className="contact">
      <h2>Contact</h2>

      <div clas="badge-base LI-profile-badge" data-locale="en_US" data-size="medium" data-theme="dark" data-type="VERTICAL" data-vanity="ryanevanscreative" data-version="v1"><a className="badge-base__link LI-simple-link" href="https://www.linkedin.com/in/ryanevanscreative?trk=profile-badge">Ryan E.</a></div>

      <script src="https://platform.linkedin.com/badges/js/profile.js" async defer type="text/javascript"></script>
    </section>
  );
}

export default Contact;
